--
-- Create procedure `Proc_officer_GetPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_officer_GetPaging (IN v_Offset int, IN v_Limit int, IN v_Sort varchar(100), IN v_Where varchar(100))
BEGIN
  -- =============================================
  -- Author:        Trần Nam Anh
  -- Created date:  19/08/2022
  -- Description:   Lấy danh sách cán bộ và tổng số nhân viên có phân trang
  -- Modified by:   
  -- Code chạy thử: CALL misa.web07.gd.trannamanh.Proc_officer_GetPaging(0, 10, NULL, "EmployeeName like '%Trường%'");
  -- =============================================

  IF IFNULL(v_Where, '') = '' THEN
    SET v_Where = '1=1';
  END IF;

  IF IFNULL(v_Sort, '') = '' THEN
    SET v_Sort = 'ModifiedDate DESC';
  END IF;

  IF v_Limit = -1 THEN
    SET @filterQuery = CONCAT('SELECT * FROM officer WHERE ', v_Where, ' ORDER BY ', v_Sort);
  ELSE
    SET @filterQuery = CONCAT('SELECT * FROM officer WHERE ', v_Where, ' ORDER BY ', v_Sort, ' LIMIT ', v_Offset, ',', v_Limit);
  END IF;

  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;

  SET @filterQuery = CONCAT('SELECT count(officerID) AS TotalCount FROM officer WHERE ', v_Where);
  PREPARE filterQuery FROM @filterQuery;
  EXECUTE filterQuery;
  DEALLOCATE PREPARE filterQuery;
END
$$

